import {  useState,useEffect } from "react";
import className from "classnames/bind";
import AOS from 'aos';
import 'aos/dist/aos.css';

import styles from "./Home.module.scss";
import { sendMessage } from "../../../Services/message";
import { getAccountForClient } from "../../../Services/account";
import { getResult } from "../../../Services/result";
import { getProject } from "../../../Services/project";
import { getSkill } from "../../../Services/skills";
import { notification } from "../../../components/notification";
import ItemProject from "./itemProject";
import LoadingIcon from './../../../components/Loading/index';

const cx = className.bind(styles);


function Home() {

    useEffect(() => {
        AOS.init(); 
    }, []);

    const [DataAccount, SetDataAccount] = useState([]);
    const [DataProject, SetDataProject] = useState([]);
    const [DataSkills, SetDataSkills] = useState([]);
    const [DataResule, SetdataResule] = useState([]);
    const [isDesProjectVisible, setDesProjectVisible] = useState(null);
    const [loading, setLoading] = useState(true);

    // lay du lieu tu form
    const [NameUserReceiver, setNameUserReceiver] = useState("");
    const [EmailReceiver, setEmailReceiver] = useState("");
    const [TitleMessage, setTitleMessage] = useState("");
    const [Content, setContent] = useState("");


    const getData = async () => {
        try {
            const account = await getAccountForClient();
            const result = await getResult();
            const project = await getProject();
            const skill = await getSkill();
            SetDataAccount(account.dataAccount);
            SetDataSkills(skill.data);
            SetDataProject(project.data);
            SetdataResule(result.data);
            
        } catch (error) {
            /* eslint-disable */console.log(...oo_oo(`687835119_51_12_51_30_4`,error));
        }
    }

    useEffect(() => {
        getData(); 
        setTimeout(() => {
            setLoading(false);
        }, 1200)
    }, []);

    const handleShowAndHidlen = (value) => {
        if(value === null){
            setDesProjectVisible(value);
        }else{
            setDesProjectVisible(value);
        }
    }
    // call api
    const fectAPI = async (e) => {
       e.preventDefault();
        const body = {
            NameUserReceiver,
            EmailReceiver,
            TitleMessage,
            Content
        }
       const response = await  sendMessage(body);
        // Reset the input fields
        if(response.status >= 400){
            notification(response.data.message, "warning");
        }else{
            notification(response.data.message, "success");
            setNameUserReceiver("");
            setEmailReceiver("");
            setTitleMessage("");
            setContent("");
        }
    }

    return ( 
 
        <main className = {cx("homeMain")}>   
        
